intro:
Responsibilities:- Testing projects (UI, functional, smoke testing, regression, integration, research, API testing, microservice platforms, mobile applications);- Taking part how tester in moving from monolith to microservices- Analysis of project documentation;- Analysis logs and work with database;- Localization and confirmation of bugs;- Fixation and control of defects correction;- Creation and updating of test documentation (Test cases / checklists / scenarios in TestRail and TestLink, runs and bugreports).Projects:- Bank web-service for companies and entrepreneurs- Systems for bank employees- Moving bank systems from monolith to microservices with new features and additional functionalityResponsibilities:
- Testing projects 
(UI, functional, smoke testing, regression, integration, research, API testing, microservice platforms, mobile applications);
- Taking part how tester in moving from monolith to microservices
- Analysis of project documentation;
- Analysis logs and work with database;
- Localization and confirmation of bugs;
- Fixation and control of defects correction;
- Creation and updating of test documentation (Test cases / checklists / scenarios in TestRail and TestLink, runs and bugreports).

Projects:
- Bank web-service for companies and entrepreneurs
- Systems for bank employees
- Moving bank systems from monolith to microservices with new features and additional functionality

- Manual integration testing and interoperability testing of information systems, responsible for gathering and distribution of information about results of competitions (CIS, INFO, TV graphics, results-data feeds (Olympic Data Feed, Internet Data Feed));- Testing of information systems for compliance to requirements of ORIS (Olympic Results Information Services);- Teamwork with IT-partners (Omega, Atos);- Monitoring of information systems for gathering and distribution of information about results of competitions during the Games;- Management of results and print distribution volunteers during the Games;- Manual integration testing and interoperability testing of information systems, responsible for gathering and distribution of information about results of competitions (CIS, INFO, TV graphics, results-data feeds (Olympic Data Feed, Internet Data Feed));
- Testing of information systems for compliance to requirements of ORIS (Olympic Results Information Services);
- Teamwork with IT-partners (Omega, Atos);
- Monitoring of information systems for gathering and distribution of information about results of competitions during the Games;
- Management of results and print distribution volunteers during the Games;

